answer = ifScript();

function ifScript() {
	if (workflow.scratchpad.parseError == '') {
		return 'no';
	}
	return 'yes';
}

(function(){
	var logger = new Logger();		
	
	var chosenCatalogString = current.variables.chosen_catalog;
	
	workflow.scratchpad.user = '';
	workflow.scratchpad.delivery_group = '';
	workflow.scratchpad.site_id = '';
	
	workflow.scratchpad.parseError = '';
	try{
		
		var chosenCatalog = JSON.parse(chosenCatalogString);
		if(!gs.nil(chosenCatalog)){
			workflow.scratchpad.user = current.request.requested_for;
			workflow.scratchpad.delivery_group = chosenCatalog.DesktopGroup.Name;
			workflow.scratchpad.site_id = chosenCatalog.SiteId;
		}		
		
	}catch(error){
		logger.logError('Error in Desktop Provisioning workflow',error);
		workflow.scratchpad.parseError = error;
	}
	
})();

